INSERT INTO `moment` VALUES (102, 210, '这样我们可以看出，两者都把属性设置到了attribute上（废话，要不人家能叫自定义属性），也就是说getAttribute/setAttribute可以操作所有的dataset内容，dataset内容只是attribute的一个子集，特殊就特殊在命名上了，但是dataset内只有带有data-前缀的属性（没有age=25那个）。那么为什么我们还要用data-*呢，一个最大的好处是我们可以把所有自定义属性在dataset对象中统一管理，遍历啊神马的都哦很方便，而不至于零零散散了，所以用用还是不错的。', '6b03e021d5ec4c30b806fbeb4b23f2fc.jpg', '2019-05-15 03:34:37', 1, 2, 0, 10, 0, 0, '2019-05-15 03:34:37', '2019-05-15 03:34:38');
