INSERT INTO `moment` VALUES (108, 0, '第六条', '49bd055542994ca7a4a871d326ec07ed.jpg', '2019-05-15 04:06:48', 1, 0, 0, 1, 0, 0, '2019-05-15 04:06:48', '2019-05-15 04:06:48');
INSERT INTO `moment` VALUES (109, 210, '是', '41a6686cf4fb44a9af2148fa5788d24b.jpg', '2019-05-15 05:03:04', 0, 1, 0, 1, 0, 0, '2019-05-15 05:03:04', '2019-05-15 05:03:05');
INSERT INTO `moment` VALUES (113, 471, 'I know that the day will come when my sight of this earth shall be lost, and life will take its leave in silence, drawing the last curtain over my eyes.Yet stars will watch at night, and morning rise as before, and hours heave like sea waves casting up pleasures and pains.When I think of this end of my moments, the barrier of the moments breaks and I see by the light of death thy world with its careless treasures. Rare is its lowliest seat, rare is its meanest of lives.Things that I longed for in vain and things that I got---let them pass. Let me but truly possess the things that I ever spurned and overlooked.', 'c7169c53da8a455b9ba9960aee224a4d.png', '2019-05-15 14:50:14', 1, 0, 0, 0, 0, 0, '2019-05-15 14:50:14', '2019-05-15 14:50:14');
INSERT INTO `moment` VALUES (114, 210, 'I know that the day will come when my sight of this earth shall be lost, and life will take its leave in silence, drawing the last curtain over my eyes.Yet stars will watch at night, and morning rise as before, and hours heave like sea waves casting up pleasures and pains.When I think of this end of my moments, the barrier of the moments breaks and I see by the light of death thy world with its careless treasures. Rare is its lowliest seat, rare is its meanest of lives.Things that I longed for in vain and things that I got---let them pass. Let me but truly possess the things that I ever spurned and overlooked.', 'bc1aa64202ff4a23b9e189e967b823fd.jpg', '2019-05-15 15:10:45', 0, 4, 0, 1, 0, 0, '2019-05-15 15:10:45', '2019-05-15 15:10:45');
INSERT INTO `moment` VALUES (115, 210, 'I know that the day will come when my sight of this earth shall be lost, and life will take its leave in silence, drawing the last curtain over my eyes.Yet stars will watch at night, and morning rise as before, and hours heave like sea waves casting up pleasures and pains.When I think of this end of my moments, the barrier of the moments breaks and I see by the light of death thy world with its careless treasures. Rare is its lowliest seat, rare is its meanest of lives.Things that I longed for in vain and things that I got---let them pass. Let me but truly possess the things that I ever spurned and overlooked.', '53f65d09950e4857939aed081a1741d5.jpg', '2019-05-15 17:16:05', 1, 8, 0, 1, 0, 0, '2019-05-15 17:16:05', '2019-05-15 17:16:06');
INSERT INTO `moment` VALUES (122, 1, 'The day is cold,and dark,and dreary; It rains,and the wind is never weary; The vine still clings to the moldering wall, But at every gust the dead leaves fall, And the day is dark and dreary.My life is cold and dark and dreary; It rains and the wind is never weary; My thought still cling to the moldering past, But the hopes of youth fall thick in the blast, And the days are dark and dreary.Be still,sad heart! And cease repining; Behind the clouds is the sun still shining; Thy fate is the common fate of all, Into each life some rain must fall, Some days must be dark and dreary.', 'bb5a2a9377c045cb80f9834e98ae1b3d.png', '2019-05-18 13:16:14', 0, 0, 0, 1, 0, 0, '2019-05-18 13:16:14', '2019-05-18 13:16:17');
INSERT INTO `moment` VALUES (124, 1, 'How many roads must a man walk downBefore you call him a man?How many seas must a white dove sailBefore she sleeps in the sand?Yes, and how many times must the cannonballs fly　　Before they’re forever banned?　　The answer, my friend, is blowin’ in the wind　　The answer is blowin’ in the wind', 'ef2dd18030da4c40be6989426810b287.jpg', '2019-05-18 13:24:05', 0, 0, 0, 1, 0, 0, '2019-05-18 13:24:05', '2019-05-18 13:24:06');
INSERT INTO `moment` VALUES (125, 1, '　Come senators, congressmen　　Please heed the call　　Don\'t stand in the doorway　　Don\'t block up the hall　　For he that gets hurt　　Will be he who has stalled　　There\'s a battle outside　　And it is ragin\'　　It\'ll soon shake your windows　　And rattle your walls　　For the times they are a-changin\'.', 'dacb837b1688422c9165c3ec55a1c6c2.jpg', '2019-05-18 13:26:15', 0, 0, 0, 1, 0, 0, '2019-05-18 13:26:15', '2019-05-18 13:26:16');
INSERT INTO `moment` VALUES (126, 1, 'Life...What is it?See it in the colors of autumn,A gentle snowfall in winter,A sudden shower in spring,The radiance of a summer day.Behold it in the laughter Of the young and the old.Know of it in a surge of hope,The blessings that are bountiful.What is life?It is joy,awareness,And the music within.', 'f74faf49f894497b94dfdd0d0b01d034.png', '2019-05-18 13:27:07', 0, 0, 0, 1, 0, 0, '2019-05-18 13:27:07', '2019-05-18 13:27:14');
INSERT INTO `moment` VALUES (128, 1, 'Life can be good,Life can be bad,Life is mostly cheerful,But sometimes sad.Life can be dreams,Life can be great thoughts;Life can mean a person,Sitting in court.Life can be dirty,Life can even be painful;But life is what you make it,So try to make it beautiful.', '5f721fcf63884e6ca99508638b237e6b.png', '2019-05-18 13:28:45', 1, 0, 0, 1, 0, 0, '2019-05-18 13:28:45', '2019-05-18 13:28:56');
